import React from "react";

import { WishlistButtonContainer } from "./wishlist-button.styles";

const WishListButton = ({ children, ...otherProps }) => {
  return (
    <WishlistButtonContainer {...otherProps}>
      {children}
    </WishlistButtonContainer>
  );
};

export default WishListButton;
